import {Route, Routes} from 'react-router-dom';
import {Navbar} from './components/Navbar';
import {Home} from './pages/Home';
import {Contact} from './pages/Contact';

function App() {
  return (
    <>
    <Navbar />
      <Routes>
        <Route path="/" element={<Home />}/>
        <Route path="/" element={<Contact />}/>
      </Routes>
    </>
  );
}

export default App;
